try {
	
	// Initial properties, settings and calculations
	
	app.preferences.rulerUnits = Units.PIXELS;
	app.displayDialogs.NO;
	
	app.activeDocument.resizeImage(null, null, 72, ResampleMethod.NONE); // Necessary to resample to 72dpi for the frame to fit
	
	var doc_height = app.activeDocument.height;
	var doc_width = app.activeDocument.width;
	var ratio = doc_height / doc_width;
	
	
	var myColor_black = new SolidColor();  
	myColor_black.rgb.red = 0;  
	myColor_black.rgb.green = 0;  
	myColor_black.rgb.blue = 0;
	
	var myColor_white = new SolidColor();  
	myColor_white.rgb.red = 255;  
	myColor_white.rgb.green = 255;  
	myColor_white.rgb.blue = 255;
	
	if (colorCheck() == "color") {
		var myColor_shadow = new SolidColor();
		
		myColor_shadow.hsb.hue = 44;
		myColor_shadow.hsb.saturation = generateRandomInteger(20, 25);
		myColor_shadow.hsb.brightness =  generateRandomInteger(80, 85); 
	} else {
		var myColor_shadow = new SolidColor();  
		
		myColor_shadow.hsb.hue = 0;
		myColor_shadow.hsb.saturation = 0;
		myColor_shadow.hsb.brightness =  generateRandomInteger(80, 85); 
	}
	
	var thisFormat = format();
	
	// Calculate feathering
	if (ratio > 1) {
		if (thisFormat == "35mm") {
			var feather = doc_width / feather_factor_35mm;
		} else if (thisFormat == "645") {
			var feather = doc_width / feather_factor_645;
		} else if (thisFormat == "45") {
			var feather = doc_width / feather_factor_45;
		} else {
			var feather = doc_width / feather_factor_67_square;
		}
	} else {
		if (thisFormat == "35mm") {
			var feather = doc_height / feather_factor_35mm;
		} else if (thisFormat == "645") {
			var feather = doc_height / feather_factor_645;
		} else if (thisFormat == "45") {
			var feather = doc_height / feather_factor_45;
		} else {
			var feather = doc_height / feather_factor_67_square;
		}
	}
	
	// Decide the shortest side
	if (ratio > 1) {
		var frame_size = doc_width;
	} else {
		var frame_size = doc_height;
	}
	
	// Scale
	var doc_scale = frame_size.value / 3600;
	
		
	
	// LET'S GET THIS SHOW GOING!!!!
	
	app.activeDocument.activeLayer.isBackgroundLayer = false; // Unlocks background layer
	app.activeDocument.activeLayer.name = "negative"; // Names background layer.
	
	// Creates paths
	createPath(choosePath("frame"), "negative"); // Choose a frame and draw the path
	createPath(choosePath("shadow"), "shadow"); // Choose a mask and draw the path
	createPath(choosePath("mask"), "mask"); // Choose a mask and draw the path
	
	if (fancy == true) {
	
		if (ratio > 1) {
			app.activeDocument.resizeCanvas(UnitValue(110,"%"), UnitValue(10 / ratio + 100,"%"), AnchorPosition.MIDDLECENTER); // Enlarge "negative" space. Ska vi verkligen ha 10% både horisontellt och vertikalt?
		} else {
			app.activeDocument.resizeCanvas(UnitValue(10 * ratio + 100,"%"), UnitValue(110,"%"), AnchorPosition.MIDDLECENTER);
		}
		
		// Creates the negative layer content
		app.activeDocument.pathItems.getByName('negative').makeSelection(feather, true); // Make selection from path
		decideRotation("frame");
		adjustSelection(); //Scales and centers the selection
		app.activeDocument.selection.invert(); // Invert selection
		app.activeDocument.selection.fill(myColor_black); // Fill with black
	
		// Creates mask layer
		app.activeDocument.artLayers.add();
		app.activeDocument.activeLayer.name = "mask"; // Names mask layer.
		app.activeDocument.activeLayer.blendMode = BlendMode.SCREEN;
		app.activeDocument.selection.selectAll();
		app.activeDocument.selection.fill(myColor_shadow); // Fill the layer with shadow color
		app.activeDocument.activeLayer.applyAddNoise(15, NoiseDistribution.GAUSSIAN, true); // Dirty upp the shadow
		app.activeDocument.activeLayer.applyGaussianBlur(feather);
	
		// Creates the mask layer content
		app.activeDocument.pathItems.getByName('shadow').makeSelection(feather * 2.5, true);
		decideRotation(thisFormat, "shadow");
		adjustSelection(); //Scales and centers the selection
		app.activeDocument.selection.invert();
		app.activeDocument.selection.fill(myColor_white); // Fill outside of the shadow with white.
		
		app.activeDocument.pathItems.getByName('mask').makeSelection(feather, true);
		decideRotation(thisFormat, "mask");
		adjustSelection(); //Scales and centers the selection
		app.activeDocument.selection.fill(myColor_black);
		
		if (eccentric == true) {
			moveNeg_fancy();
		}
		
	} else {
		
		// Conservative mode
		
		if (thisFormat == "35mm") {
			if (ratio > 1) {
				app.activeDocument.resizeCanvas(UnitValue(border_width_35mm + 100,"%"), UnitValue(border_width_35mm / ratio + 100,"%"), AnchorPosition.MIDDLECENTER); 
			} else {
				app.activeDocument.resizeCanvas(UnitValue(border_width_35mm * ratio + 100,"%"), UnitValue(border_width_35mm + 100,"%"), AnchorPosition.MIDDLECENTER);
			}
		} else if (thisFormat == "645") {
			if (ratio > 1) {
				app.activeDocument.resizeCanvas(UnitValue(border_width_645 + 100,"%"), UnitValue(100,"%"), AnchorPosition.MIDDLECENTER);
			} else {
				app.activeDocument.resizeCanvas(UnitValue(100,"%"), UnitValue(border_width_645 + 100,"%"), AnchorPosition.MIDDLECENTER);
			}
		} else if (thisFormat == "67") {
			if (ratio > 1) {
				app.activeDocument.resizeCanvas(UnitValue(border_width_67 + 100,"%"), UnitValue(border_width_67 / ratio + 100,"%"), AnchorPosition.MIDDLECENTER);
			} else {
				app.activeDocument.resizeCanvas(UnitValue(border_width_67 * ratio + 100,"%"), UnitValue(border_width_67 + 100,"%"), AnchorPosition.MIDDLECENTER);
			}
		} else if (thisFormat == "45") {
			if (ratio > 1) {
				app.activeDocument.resizeCanvas(UnitValue(100.5,"%"), UnitValue(border_width_45 / ratio + 100,"%"), AnchorPosition.MIDDLECENTER);
			} else {
				app.activeDocument.resizeCanvas(UnitValue(border_width_45 * ratio + 100,"%"), UnitValue(100.5,"%"), AnchorPosition.MIDDLECENTER);
			}
		} else if (thisFormat == "square") {
			if (ratio > 1) {
				app.activeDocument.resizeCanvas(UnitValue(border_width_square + 100,"%"), UnitValue(border_width_square / ratio + 100,"%"), AnchorPosition.MIDDLECENTER);
			} else {
				app.activeDocument.resizeCanvas(UnitValue(border_width_square * ratio + 100,"%"), UnitValue(border_width_square + 100,"%"), AnchorPosition.MIDDLECENTER);
			}
		}
		
		// Creates the negative layer content
		app.activeDocument.pathItems.getByName('negative').makeSelection(feather, true); // Make selection from path
		decideRotation("frame");
		adjustSelection(); //Scales and centers the selection
		app.activeDocument.selection.invert(); // Invert selection
		app.activeDocument.selection.fill(myColor_black); // Fill with black
		
		// Creates fill layer
		app.activeDocument.artLayers.add();
		app.activeDocument.activeLayer.name = "fill"; // Names mask layer.
		app.activeDocument.activeLayer.blendMode = BlendMode.SCREEN;
		app.activeDocument.selection.selectAll();
		app.activeDocument.selection.fill(myColor_black); // Fill the layer with black
		
		if (eccentric == true) {
			moveNeg();
		}
		
	}

	// Finish up
	app.activeDocument.selection.deselect();
	app.activeDocument.pathItems.getByName('negative').remove();
	app.activeDocument.pathItems.getByName('shadow').remove();
	app.activeDocument.pathItems.getByName('mask').remove();
	app.activeDocument.flatten(); // Flatten all layers
	
	//app.activeDocument.save(); // Saves file. Comment out when testing script.
	//app.activeDocument.close(); // Closes file. Comment out when testing script.
	
	// ALL DONE!
	
} catch (e) { alert(e); }
